EXTRATO DO SÉTIMO TERMO ADITIVO AO CONTRATO Nº 032/2009. xxecet
Processo: 392.010.706/2010 Partes: Companhia de Desenvolvimento Habitacional do Distrito
—
Federal/CODHAB e a Empresa DISBRAVE Locadora de Veículos LTDA, Objeto: O presente
termo objetiva a prorrogação por mais 12 (doze) meses a partir de 12 de dezembro de 2012, com
fulcro no $ 2º, artigo 57 da Lei nº 8.666/93 e suas alterações; Valor: O valor total do contrato é
de R$ 240.303,48 (duzentos e quarenta mil e trezentos e três reais e quarenta e oito centavos);
Data da Assinatura: 10/12/2012. Data da publicação no DODF do Contrato original: 16/12/2009;
Signatários: Pela CODHAB/DF: Luciano Nóbrega Queiroga, na qualidade de Diretor-Presidente;
Pela Contratada: Rosélia Franco Soares, na qualidade de Representante Legal
